import Logo from './Logo'

class Sidepanel extends React.Component {
    render(){
        return (
            <div class="parent">
            <div className="col-md-3">
                <Logo />
                <div className="side-nav">
                    This is the side panel.
                </div>
                
            </div>
            
            <style jsx>{`
            .side-nav{
                border-right: 2px solid #fff;
                /*height: 100%;*/
            }
            .parent{
                display: flex;
            }
            .col-md-3{
                height: 100%;
                /*position: absolute;*/
            }
        `}</style>
            </div>
        );
    }
}

export default Sidepanel;
